function setCookie(e,o,t){var n=new Date;n.setDate(n.getDate()+t),document.cookie=e+"="+escape(o)+"; expires="+n.toUTCString(),console.log("cookie "+e+" created")}function getCookie(e){var o=new RegExp(e+"=(?<value>[0-9a-zA-Zs]+);?"),t=document.cookie.match(o);if(t)return t.groups.value}function showCookieBanner(e){getCookie(e)||document.getElementById(e).classList.add("active")}function hideCookieBanner(e){document.getElementById(e).classList.remove("active"),setCookie(e,!0,0)}showCookieBanner("c1"),showCookieBanner("c2"),showCookieBanner("c3");